import React from 'react';
import "./Checkout.css";

function Checkout() {
    return (
        <div className="checkout">
           <div className="checkout_left">
               <img className="checkout_ad" src="https://png.pngtree.com/png-clipart/20190925/original/pngtree-mobile-payment-on-mobile-phones-png-image_5001840.jpg"/>

               <div>
                   <h2 className="checkout_title">Your shopping basket</h2>
               </div>

               <div>
                    <h2 className="checkout_right"></h2>
               </div>

           </div>
        </div>
    )
}


export default Checkout;
